const initialState = {
    showMyLearningTooltip: false 
}

export function myLearningToolTip(state = initialState, action) {
    switch (action.type) {
        case SHOW_MY_LEARNING_TOOLTIP:
            return {
                ...state,
                showMyLearningTooltip: action.data
            };
        default:
            return state
    }
}
